INSERT INTO `notice` VALUES ('欢迎使用SkyDream飞控系统','','2023-09-09','SkyDream-技术组'),('SkyDream Club连飞规则','禁止使用ECHO连接服务器\r\nSkyDream Club连飞活动，大家请提前下载好：swfit和KooK这两款软件 swfit使用教程可看群内视频和教程，kook当天会发邀请链接，记得及时查看，没有地景的小伙伴在群内提前下载好地景，群内有对话术语提前准备好，新手连飞这次活动也是没关系的，一定要熟悉自己机型操作，以免耽误时间，举办活动不易，请报名的朋友积极参加。感谢大家！','2023-11-15','SkyDreamClub管理组'),('2023年11月17日管制活动','本次活动南京起飞机组需要向管制（联系管制1756）申请停机位，先申请，才能进入机场进行冷舱，申请同意后，方可进行活动，不申请，直接落地的，警告两次不听的，提出活动（申请者，参与活动这，计入本月管制活动参与次数）','2023-11-15','SkyDreamClub管理组');
